  palette: {
    primary: {
      light: '#FFFFFF',
      main: '#FFFFFF',
      dark: '#FFFFFF',
      contrastText: '#fff',
    },
    secondary: {
      light: '#FFFFFF',
      main: '#FFFFFF',
      dark: '#FFFFFF',
      contrastText: '#FFFFFF',
    },
  },
});

function App() {
  return (
    <div className="App">
      <Tabs></Tabs>
      {/* <SignIn></SignIn> */}
      <Preview></Preview>
      <Modal></Modal>
    </div>
  );
}

export default App;
